#include <algorithm>
#include <cassert>
#include <chrono>
#include <iostream>
#include <string>
#include <vector>

class Solution {
public:
    static std::vector<std::string> wordSubsets(std::vector<std::string>& words1, std::vector<std::string>& words2) {
        std::vector<uint8_t> universeCode(26, 0);
        for (const auto& w : words2) {
            std::vector<uint8_t> wCode = Solution::getStringCode(w);
            for (uint8_t i = 0; i < Solution::CODE_LEN; ++i) {
                universeCode[i] = std::max(universeCode[i], wCode[i]);
            }
        }

        std::vector<std::string> result;
        result.reserve(words1.size());
        for (const auto& w1 : words1) {
            std::vector<uint8_t> w1Code = Solution::getStringCode(w1);
            bool w1_is_universal = true;
            for (uint8_t i = 0; i < Solution::CODE_LEN; ++i) {
                if (w1Code[i] < universeCode[i]) {
                    w1_is_universal = false;
                    break;
                }
            }
            if (w1_is_universal)
                result.push_back(w1);
        }
        result.shrink_to_fit();

        return result;
    }

    static std::vector<uint8_t> getStringCode(const std::string& s) {
        std::vector<uint8_t> stringCode(26, 0);
        for (const auto& ch : s)
            stringCode[static_cast<int>(ch - 'a')]++;

        return stringCode;
    }
private:
    static const int CODE_LEN = 26;
};

